import { useEffect, useState } from "react";
import axios from "axios";

function Books() {
  const [books, setBooks] = useState([]);
  const [newBook, setNewBook] = useState({ title: "", author: "", year: "" });
  const [editingBookId, setEditingBookId] = useState(null);
  const [editBook, setEditBook] = useState({ title: "", author: "", year: "" });

  const token = localStorage.getItem("token");

  const fetchBooks = async () => {
    try {
      const res = await axios.get("http://localhost:8080/api/books", {
        headers: { "x-access-token": token },
      });
      setBooks(res.data);
    } catch (error) {
      console.error("Błąd pobierania książek:", error);
    }
  };

  const handleAddBook = async () => {
    try {
      await axios.post("http://localhost:8080/api/books", newBook, {
        headers: { "x-access-token": token },
      });
      setNewBook({ title: "", author: "", year: "" });
      fetchBooks();
    } catch (error) {
      console.error("Błąd dodawania książki:", error);
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:8080/api/books/${id}`, {
        headers: { "x-access-token": token },
      });
      fetchBooks();
    } catch (error) {
      console.error("Błąd usuwania książki:", error);
    }
  };

  const handleEditStart = (book) => {
    setEditingBookId(book._id);
    setEditBook({ title: book.title, author: book.author, year: book.year });
  };

  const handleEditSubmit = async () => {
    try {
      await axios.put(`http://localhost:8080/api/books/${editingBookId}`, editBook, {
        headers: { "x-access-token": token },
      });
      setEditingBookId(null);
      fetchBooks();
    } catch (error) {
      console.error("Błąd edycji książki:", error);
    }
  };

  useEffect(() => {
    fetchBooks();
  }, []);

  return (
    <div>
      <h2>Książki</h2>

      {/* Formularz dodawania */}
      <div>
        <input
          type="text"
          placeholder="Tytuł"
          value={newBook.title}
          onChange={(e) => setNewBook({ ...newBook, title: e.target.value })}
        />
        <input
          type="text"
          placeholder="Autor"
          value={newBook.author}
          onChange={(e) => setNewBook({ ...newBook, author: e.target.value })}
        />
        <input
          type="number"
          placeholder="Rok"
          value={newBook.year}
          onChange={(e) => setNewBook({ ...newBook, year: e.target.value })}
        />
        <button onClick={handleAddBook}>Dodaj książkę</button>
      </div>

      {/* Lista książek */}
      <ul>
        {books.map((book) => (
          <li key={book._id}>
            {editingBookId === book._id ? (
              <>
                <input
                  type="text"
                  value={editBook.title}
                  onChange={(e) => setEditBook({ ...editBook, title: e.target.value })}
                />
                <input
                  type="text"
                  value={editBook.author}
                  onChange={(e) => setEditBook({ ...editBook, author: e.target.value })}
                />
                <input
                  type="number"
                  value={editBook.year}
                  onChange={(e) => setEditBook({ ...editBook, year: e.target.value })}
                />
                <button onClick={handleEditSubmit}>Zapisz</button>
                <button onClick={() => setEditingBookId(null)}>Anuluj</button>
              </>
            ) : (
              <>
                <strong>{book.title}</strong> – {book.author} ({book.year})
                <button onClick={() => handleEditStart(book)}>Edytuj</button>
                <button onClick={() => handleDelete(book._id)}>Usuń</button>
              </>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Books;
